import React, { useState, useEffect } from "react";
import axios from "axios";

const BookList = () => {
  const [books, setBooks] = useState([]);
  const [locations, setLocations] = useState([]);
  const [selectedLocation, setSelectedLocation] = useState("MIC Campus"); // Default location name
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    // Fetch available locations from the backend
    axios
      .get("http://localhost:8080/lms/locations")
      .then((response) => {
        // Extract only the 'name' of each location
        const locationNames = response.data.map((location) => location.name);
        setLocations(locationNames);  // Set the location names
      })
      .catch((error) => console.error("Error fetching locations:", error));

    // Fetch books for the selected location
    fetchBooks();
  }, [selectedLocation]);

  // Fetch books based on selected location
  const fetchBooks = async () => {
    setLoading(true);
    try {
      const response = await axios.get(
        `http://localhost:8080/lms/books/grouped?locationName=${selectedLocation}&page=0&size=10`
      );
      setBooks(response.data.books);
    } catch (error) {
      console.error("Error fetching books:", error);
    } finally {
      setLoading(false);
    }
  };

  const handleLocationChange = (e) => {
    setSelectedLocation(e.target.value); // Update selected location name
  };

  return (
    <div className="container mx-auto p-4">
      <h2 className="text-2xl font-semibold mb-4">Book List</h2>

      {/* Location filter */}
      <div className="mb-4">
        <label htmlFor="location" className="mr-2">Select Location:</label>
        <select
          id="location"
          value={selectedLocation}
          onChange={handleLocationChange}
          className="border border-gray-300 p-2 rounded"
        >
          {locations.map((locationName) => (
            <option key={locationName} value={locationName}>
              {locationName}
            </option>
          ))}
        </select>
      </div>

      {loading ? (
        <div>Loading...</div>
      ) : (
        <>
          {/* Book Table */}
          <table className="table-auto w-full border-collapse border border-gray-300">
            <thead>
              <tr className="bg-gray-100">
                <th className="px-4 py-2">Book Name</th>
                <th className="px-4 py-2">Description</th>
                <th className="px-4 py-2">Edition</th>
                <th className="px-4 py-2">Author</th>
                <th className="px-4 py-2">ISBN</th>
                <th className="px-4 py-2">Location</th>
                <th className="px-4 py-2">Category</th>
                <th className="px-4 py-2">Available Count</th>
              </tr>
            </thead>
            <tbody>
              {books.map((book) => (
                <tr key={book.isbnNumber}>
                  <td className="px-4 py-2">{book.bookName}</td>
                  <td className="px-4 py-2">{book.description}</td>
                  <td className="px-4 py-2">{book.edition}</td>
                  <td className="px-4 py-2">{book.authorName}</td>
                  <td className="px-4 py-2">{book.isbnNumber}</td>
                  <td className="px-4 py-2">{book.location}</td>
                  <td className="px-4 py-2">{book.category}</td>
                  <td className="px-4 py-2">{book.availableCount}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </>
      )}
    </div>
  );
};

export default BookList;
